entityDefinitions:
  respondent:
    fqn: "general.person"
    entitySetName: "CAFE_MAQ_Respondents"
    propertyDefinitions:
      nc.SubjectIdentification:
        type: "nc.SubjectIdentification"
        transforms:
        - !<transforms.HashTransform>
          columns: ["respondent_id"]
          hashFunction: "sha256"
    name: "respondent"

  subject:
    fqn: "general.person"
    entitySetName: "CAFE_MAQ_Children"
    propertyDefinitions:
      nc.SubjectIdentification:
        type: "nc.SubjectIdentification"
        column: child_id
    name: "subject"

# *****QUESTIONS FOR 8-18 months*********
  choochoo:
    fqn: "ol.vocabulary"
    entitySetName: "CAFE_MAQ_ChildLanguageAssessment"
    propertyDefinitions:
      ol.id:
        type: "ol.id"
        transforms:
        - !<transforms.ConcatCombineTransform>
          transforms:
          - !<transforms.ConcatTransform>
            columns: ["Q93_1"]
            separator: "_"
          - !<transforms.ValueTransform>
            value: "choo_choo"
      ol.vocabularyword:
        type: "ol.vocabularyword"
        transforms:
        - !<transforms.ValueTransform>
          value: "choo choo"
      ol.name:
        type: "ol.name"
        column: "Q93_1"
        transforms:
        - !<transforms.ReplaceTransform>
          target: ["1", "2", "3"]
          goal: ["Understands the word and says it", "Understands the word but does not yet say it", "Does not understand the word"]
    conditions:
    - !<conditions.BooleanIsNullCondition>
      column: "Q93_1"
      reverse: true
    name: "choochoo"

